import React from 'react';

const products = [
    {
      id: 1,
      title: "Laptop Backpack",
      price: 109.95,
      description: "A cool laptop backpack",
      image: "https://fakestoreapi.com/img/81fPKd-2AYL._AC_SL1500_.jpg",
      rating: 3.9,
    },
    {
      id: 2,
      title: "Casual T-Shirt for Men",
      price: 22.3,
      description: "Slim-fitting style, t-shoty for men",
      image:
        "https://fakestoreapi.com/img/71-3HjGNDUL._AC_SY879._SX._UX._SY._UY_.jpg",
      rating: 4.1,
    },
    {
      id: 3,
      title: "Mens Cotton Jacket",
      price: 55.99,
      description: "Great outerwear jackets for spring, autumn, or winter.",
      image: "https://fakestoreapi.com/img/71li-ujtlUL._AC_UX679_.jpg",
      rating: 4.7,
    },
    {
      id: 4,
      title: "Mens Casual Slim Fit",
      price: 15.99,
      description: "An aweome shirt for men",
      image: "https://fakestoreapi.com/img/71YXzeOuslL._AC_UY879_.jpg",
      rating: { rate: 2.1, count: 430 },
    },
    {
      id: 5,
      title: "Women's Gold & Silver Bracelet",
      price: 695,
      description: "A very cool bracelet.",
      image: "https://fakestoreapi.com/img/71pWzhdJNwL._AC_UL640_QL65_ML3_.jpg",
      rating: 400,
    },
    {
      id: 6,
      title: "Solid Gold Petite Micropave",
      price: 168,
      description: "A very cool jewlery for women",
      image: "https://fakestoreapi.com/img/61sbMiUnoGL._AC_UL640_QL65_ML3_.jpg",
      rating: 3.9,
    },
    {
      id: 7,
      title: "White Gold Plated Princess",
      price: 9.99,
      description: "A great diamond engagement ring for her.",
      image: "https://fakestoreapi.com/img/71YAIFU48IL._AC_UL640_QL65_ML3_.jpg",
      rating: 3,
    },
    {
      id: 8,
      title: "Gold-plated Earrings",
      price: 10.99,
      description: "Rose Gold Plated Double Flared Tunnel Plug Earrings.",
      image: "https://fakestoreapi.com/img/51UDEzMJVpL._AC_UL640_QL65_ML3_.jpg",
      rating: 1.9,
    },
  ];

function ProductList(props) {
    return (
        <div>
            <div class="card">
                <img class="card-img-top" src="https://static8.depositphotos.com/1431107/950/i/450/depositphotos_9505845-stock-photo-new-product-stamp.jpg" alt="Product Image"/>
                <div class="card-body">
                    <h5 class="card-title">Card title</h5>
                    <p class="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
                    <a href="#" class="btn btn-primary">Go somewhere</a>
                </div>
            </div>
        </div>
    );
}

export default ProductList;
